prompt --application/shared_components/plugins/region_type/com_gpmfactory_resource_diagram
begin
wwv_flow_api.create_plugin(
 p_id=>wwv_flow_api.id(36391523711767813062)
,p_plugin_type=>'REGION TYPE'
,p_name=>'COM.GPMFACTORY.RESOURCE_DIAGRAM'
,p_display_name=>'Resource Diagram'
,p_supported_ui_types=>'DESKTOP'
,p_javascript_file_urls=>wwv_flow_string.join(wwv_flow_t_varchar2(
'#PLUGIN_FILES#moment-with-locales.min.js',
'#PLUGIN_FILES#vis.min.js'))
,p_css_file_urls=>'#PLUGIN_FILES#vis.min.css'
,p_plsql_code=>wwv_flow_string.join(wwv_flow_t_varchar2(
'-- Oracle APEX plugin: Resource Diagram Plugin',
'-- GPM FACTORY - march 2019',
'-- https://github.com/patrickmonaco/resource_diagram_plugin',
'-- developer site: https://gpmfactory.com',
'-- based on VIS timeline module (http://visjs.org)',
'',
'FUNCTION render_plan',
'    (p_region IN APEX_PLUGIN.t_region',
'    ,p_plugin IN APEX_PLUGIN.t_plugin',
'    ,p_is_printer_friendly IN BOOLEAN',
'    ) RETURN APEX_PLUGIN.t_region_render_result IS',
'    ',
'    SUBTYPE plugin_attr is VARCHAR2(32767);',
'    l_mode_col      plugin_attr := p_region.attribute_05;      -- Edit Mode',
'    l_zoommin       plugin_attr := p_region.attribute_14;      -- Zoom min',
'    l_options       plugin_attr := p_region.attribute_06;      -- Options',
'    l_locale        plugin_attr := p_region.attribute_15;      -- Locale',
'    ',
'    l_result     APEX_PLUGIN.t_region_render_result;',
'    l_script     varchar2(32767);',
'    l_data       APEX_APPLICATION_GLOBAL.VC_ARR2;',
'    l_js_params  varchar2(1000);  ',
'    l_count      pls_integer; ',
'    timeline     varchar2(32000);  ',
'    tnames       varchar2(2000);',
'    tflag        varchar2(1);',
'    t2           varchar2(32000);',
'    tnb          integer := 0;',
'    tnbg         integer := 0; ',
'    t_nb         integer := 0;',
'    flag_edit    varchar2(10) := ''false'';',
'    tbox         INTEGER := 1;',
'    tapp         INTEGER := :APP_ID;',
'    l_ajax_id    VARCHAR2(100);',
' ',
'BEGIN',
'',
'-- debug information will be included',
'IF APEX_APPLICATION.g_debug then',
'    APEX_PLUGIN_UTIL.debug_region',
'        (p_plugin => p_plugin',
'        ,p_region => p_region',
'        ,p_is_printer_friendly => p_is_printer_friendly',
'    );',
'END IF;',
'--htp.p(p_region.source);',
'-- get the identifier of plugin Ajax process',
'l_ajax_id := apex_plugin.get_ajax_identifier;',
'',
'-- get misc diagram options',
'if upper(l_mode_col) = ''TRUE'' then',
'   flag_edit := ''true'';',
'end if;',
'if upper(l_options) = ''BOX'' then',
'    tbox := 1;',
'else',
'    tbox := 0;',
'end if;',
'',
'-- -----------------------------------------',
'-- build the Javascript code and HTML markup',
'-- -----------------------------------------',
'',
'htp.p(''',
'<div id="visualization"></div>',
'<script type="text/javascript">',
'// Global variables      ',
'  var ds;',
'  var groupCount; ',
'  var itemCount; ',
'  var names; ',
'  var items;',
'  var items2;    ',
'  var timeline; ',
'  var groups;  ',
'      ',
'function renderPlan(pData){          ',
'  var now = moment().minutes(0).seconds(0).milliseconds(0);   ',
'  groupCount = pData.data.tnbg;',
'  itemCount = pData.data.tnb;',
'  names = pData.data.groups;',
'  ds = pData.data.tasks; ',
'      ',
' // create a data set with groups (Resource Names)     ',
'  groups = new vis.DataSet();    ',
' for (var g = 0; g < groupCount; g++) {',
'    groups.add({id: g, content: names[g]});',
' }',
'',
' // create a dataset with items',
' items = new vis.DataSet();',
' for (var i = 0; i < itemCount; i++) {',
'     var group = names.indexOf(ds[i].group);',
'     items.add({',
'         id: i,',
'         group: group,',
'         //content: ds[i].content +',
'         //    '''' <span style="color:#97B0F8;">('''' + names[group] + '''')</span>'''',',
'         content: ds[i].content,',
'         start: ds[i].start,',
'         end: ds[i].end''||',
'         CASE when tbox = 1 then '', type: "box"'' END || ''',
'    });',
' }',
'',
'      ',
'      // create visualization',
' var container = document.getElementById("visualization");',
' var options = {',
'    groupOrder: ''''content'''', '' ',
'    || CASE when flag_edit = ''true'' then ''',
'    editable: {',
'        add: true,         // add new items by double tapping',
'        updateTime: true,  // drag items horizontally',
'        updateGroup: true, // drag items from one group to another',
'        remove: true,       // delete an item by tapping the delete button top right',
'        overrideItems: false  // allow these options to override item.editable',
'      },'' END || ''',
'    onAdd: function (item, callback){',
'       editTask("add",items,item,callback); ',
'    },',
'    onUpdate: function (item, callback){',
'       editTask("update",items,item,callback);',
'    },',
'    onMove: function (item, callback) {',
'       editTask("move",items,item,callback);',
'   ',
'   },',
'    onRemove: function (item, callback){ ',
'       editTask("remove",items,item,callback);   ',
'    },',
'    locale: "''|| l_locale ||''",  ',
'   tooltipOnItemUpdateTime: true   ',
'   // min: "2019-03-03",                // lower limit of visible range',
'   // max: "2019-03-07",                // upper limit of visible range',
'   // , zoomMin: 1000 * 60 * 60 * 24            // one day in milliseconds',
'     , zoomMin: ''|| l_zoommin ||''  ',
'   // zoomMax: 1000 * 60 * 60 * 24 * 31 * 3     // about three months in milliseconds',
' };',
'     ',
'  timeline = new vis.Timeline(container, items, groups, options);',
'//var timeline = new vis.Timeline(container);',
'      ',
'// timeline.setOptions(options);',
'// timeline.setGroups(groups);',
'// timeline.setItems(items);',
'     ',
'} ',
'function prepareData(pData){',
'  groupCount = pData.data.tnbg;',
'  itemCount = pData.data.tnb;',
'  names = pData.data.groups;',
'  ds = pData.data.tasks; ',
'  //console.log("count fonc="+groupCount);  ',
'} ',
'function redraw(){',
'  apex.server.plugin ( ',
'              "''|| l_ajax_id ||''"',
'                ,{ x01: "data"      ',
'                } ',
'             , { dataType: "text"',
'                 ,success: function(pData){',
'                    var d1 = JSON.parse(pData);  ',
'                    var now = moment().minutes(0).seconds(0).milliseconds(0);',
'                    // create a data set with groups (Resource Names)',
'                    groupCount = d1.data.tnbg;',
'                    itemCount = d1.data.tnb;',
'                    names = d1.data.groups;',
'                    ds = d1.data.tasks; ',
'                    // create a dataset with items ',
'                    items2 = new vis.DataSet();',
'                    for (var i = 0; i < itemCount; i++) {',
'                       var group = names.indexOf(ds[i].group);',
'                       items2.add({',
'                           id: i,',
'                           group: group,',
'                           content: ds[i].content,',
'                           start: ds[i].start,',
'                           end: ds[i].end''||',
'                           CASE when tbox = 1 then '', type: "box"'' END || ''',
'                        });',
'                     }',
'                    timeline.setItems(items2);',
'                    timeline.redraw();',
'                  }',
'            }',
'    ); ',
'} ',
'function editTask(paction,items,item,callback){',
'   var tid;',
'   var str; ',
'   flagedit = 1;   ',
'   str = moment(item.start).format("MM-DD-YYYY HH:mm:ss");',
'   if (paction == "add") {',
'          tid = "";',
'      } else { tid = ds[item.id].id;',
'   }    ',
'   apex.server.plugin ( ',
'         "''|| l_ajax_id ||''",',
'         { x01: "link", ',
'           x02: tid,',
'           x03: names[item.group], ',
'           x04: str',
'         },',
'        { dataType: "text",',
'            success: function(pData){  ',
'                console.log(pData);',
'                eval("var myWindow="+ pData );',
'            }       ',
'         }   ',
'   );',
'} ',
'      ',
'function getData(){ ',
'    apex.server.plugin ( ',
'        "''|| l_ajax_id ||''"',
'         ,   {   x01: "data"',
'         }',
'      , { dataType: "text"',
'        ,success: function(pData){',
'            //console.log(pData); ',
'             var d1 = JSON.parse(pData); ',
'             renderPlan(d1); ',
'             }       ',
'        });      ',
'}       ',
'',
'</script>',
''');',
'',
'    apex_javascript.add_onload_code (',
'        p_code => ''',
'        // close dialog event',
'        apex.jQuery( "body" ).on( "apexafterclosedialog", function( event ) {  ',
'            // refresh the timeline',
'            redraw();',
'        });',
'        getData();''',
'    );',
'  ',
'return l_result;',
'END;',
'',
'',
'function get_data (',
'    p_region in apex_plugin.t_region,',
'    p_plugin in apex_plugin.t_plugin',
') return apex_plugin.t_region_ajax_result ',
'is',
' ',
'    SUBTYPE         plugin_attr is VARCHAR2(32767);',
'    -- Component attributes',
'    l_res_col       plugin_attr := p_region.attribute_01;      -- Resource column name',
'    l_taskname_col  plugin_attr := p_region.attribute_02;      -- Task Name',
'    l_id_col        plugin_attr := p_region.attribute_03;      -- Unique ID',
'    l_start_col     plugin_attr := p_region.attribute_04;      -- Start date column',
'    l_end_col       plugin_attr := p_region.attribute_07;      -- End Date column (optionnal)',
'    ',
'    ',
'    l_ires_col      plugin_attr := p_region.attribute_13;      -- Resource internal value column',
'    l_detail_page   plugin_attr := p_region.attribute_12;      -- Detail page number',
'    l_start_item    plugin_attr := p_region.attribute_08;      -- Start date item',
'    l_id_item       plugin_attr := p_region.attribute_10;      -- Id item',
'    l_res_item      plugin_attr := p_region.attribute_09;      -- Resource item',
'    l_date_format   plugin_attr := p_region.attribute_11;      -- Date format for detail',
'    ',
'    ',
'    l_url           varchar2(8000);',
'    l_class         varchar2(255);',
'    l_app           number := v(''APP_ID'');',
'    l_session       number := v(''APP_SESSION'');',
'    l_start         VARCHAR2(2000);',
'    l_region_source varchar2(32767) := p_region.source;',
'    l_data_source   varchar2(32767);',
'    l_res_source    varchar2(32767);',
'    l_bind_list     apex_plugin_util.t_bind_list;',
'    ',
'    l_region      varchar2(100);',
'    l_script      varchar2(32767);',
'    l_data        APEX_APPLICATION_GLOBAL.VC_ARR2;',
'    l_js_params   varchar2(1000);',
'    l_res_val     VARCHAR2(2000);',
'    l_ires_val    VARCHAR2(2000);',
'    l_task_val    VARCHAR2(2000);',
'    l_start_val   VARCHAR2(100);',
'    l_zstart_val  VARCHAR2(100);',
'    l_end_val     VARCHAR2(100);',
'    l_zend_val    VARCHAR2(100);',
'    l_id_val      VARCHAR2(100);',
'    l_startd_val  DATE;',
'    ',
'    l_count       pls_integer; ',
'    l_gvalue_list apex_plugin_util.t_column_value_list2;',
'    l_cvalue_list apex_plugin_util.t_column_value_list2;',
'    l_element     varchar2(4000);',
'    timeline      varchar2(32000);',
'    ',
'    tnames       varchar2(2000);',
'    tflag        varchar2(1);',
'    tdata        varchar2(32000);',
'    t2           varchar2(32000);',
'    ',
'    tnb          integer := 0;',
'    tnbg         integer := 0;',
'    res_colno    pls_integer;',
'    ires_colno   pls_integer;',
'    task_colno   pls_integer;',
'    start_colno  pls_integer;',
'    id_colno     pls_integer;',
'    end_colno    pls_integer;',
'    zstart_colno pls_integer;',
'    zend_colno   pls_integer;',
'    t_nb         integer := 0;',
'    flag_edit    varchar2(10) := ''false'';',
'    tbox         INTEGER := 1;',
'    tapp         INTEGER := :APP_ID;',
'    l_ajax_id    VARCHAR2(100);',
'begin',
'   ',
'   -- process is called for building Detail URL',
'   ',
'    if  APEX_APPLICATION.g_x01 != ''data'' then   ',
'        l_start :=  to_char(to_date(APEX_APPLICATION.g_x04,''MM-DD-YYYY HH24:MI:SS''),l_date_format);',
'        l_start := ''\'' || l_start  || ''\''; -- because colon inside the datetime leads to the removing of the last part (seconds) ',
'        l_url := substr(APEX_UTIL.PREPARE_URL(',
'            p_url => ''f?p='' || l_app || '':''||l_detail_page||'':''||l_session||''::NO::''||',
'                l_id_item||'',''||',
'                l_res_item||'',''||',
'                l_start_item||'':''||',
'                APEX_APPLICATION.g_x02||'',''||',
'                APEX_APPLICATION.g_x03||'',''||',
'                l_start,',
'            p_checksum_type => ''SESSION''),12);  -- remove "javascript:"',
'        htp.p(l_url);',
'        return  null;',
'    end if;',
'--',
'-- Process is called for retrieving data',
'--',
'-- Build the query which returns groups',
'--htp.p(''source=''|| p_region.source);',
'  l_res_source := ''select DISTINCT NVL(to_char('' || l_res_col ||''),''''TBD'''') '' || l_res_col ||'' from ('' || rtrim(l_region_source, '' ;'') || '') ORDER BY 1 '';',
'-- overide main query in order to retrieve TIME  ',
'  l_data_source := ''select a.*, to_char(''||l_start_col||'', ''''YYYY-MM-DD"T"HH24:MI:SS'''') Z_START ''|| ',
'  CASE when l_end_col IS NOT NULL then '', to_char(''||l_end_col||'', ''''YYYY-MM-DD"T"HH24:MI:SS'''') Z_END '' END || '' ',
'  from ('' || rtrim(l_region_source, '' ;'') || '') a where ''||l_start_col || '' is not null''; ',
'  l_region_source := l_data_source;',
'  -- sys.htp.p(l_res_source);',
'-- Read the data based on the previous query',
'--htp.p(l_data_source);',
'',
'l_gvalue_list := apex_plugin_util.get_data2 (',
'                            p_sql_statement  => l_res_source,',
'                            p_min_columns    => 1,',
'                            p_max_columns    => null,',
'                            p_component_name => p_region.name,',
'                            p_bind_list      => l_bind_list',
'                       );',
'',
'-- get colno',
'',
'res_colno   := apex_plugin_util.get_column_no (',
'                    p_attribute_label   => ''Parent Element Column'',',
'                    p_column_alias      => l_res_col,',
'                    p_column_value_list => l_gvalue_list,',
'                    p_is_required       => true,',
'                    p_data_type         => apex_plugin_util.c_data_type_varchar2',
'               );  ',
'                                                ',
' -- initialize resource names array',
'tnames := ''[''; ',
'for i in 1 .. l_gvalue_list(1).value_list.count loop   ',
'     l_element := apex_plugin_util.get_value_as_varchar2 (',
'                            p_data_type => l_gvalue_list(res_colno).data_type,',
'                            p_value     => l_gvalue_list(res_colno).value_list(i)',
'                       );  ',
'     tnbg := tnbg +1;',
'     tnames := tnames ||''"''||l_element||''",'';            ',
'end loop;',
'tnames := substr(tnames,1,(length(tnames)-1)) || '']'';',
'',
'-- -------------------------------------',
'-- Get the time datas from the main query',
'-- -------------------------------------',
'l_cvalue_list := apex_plugin_util.get_data2 (',
'                      p_sql_statement  => l_region_source,',
'                      p_min_columns    => 2,',
'                      p_max_columns    => null,',
'                      p_component_name => p_region.name,',
'                      p_bind_list      => l_bind_list',
'                 );',
'             ',
'-- -------------------------------------',
'-- Get the column id ',
'-- -------------------------------------',
'res_colno  := apex_plugin_util.get_column_no (',
'                   p_attribute_label   => ''Resource Column name'',',
'                   p_column_alias      => l_res_col,',
'                   p_column_value_list => l_cvalue_list,',
'                   p_is_required       => true,',
'                   p_data_type         => apex_plugin_util.c_data_type_varchar2',
'              ); ',
'if l_ires_col is not null then',
'    ires_colno  := apex_plugin_util.get_column_no (',
'                       p_attribute_label   => ''Resource internal Column name'',',
'                       p_column_alias      => l_ires_col,',
'                       p_column_value_list => l_cvalue_list,',
'                       p_is_required       => true,',
'                       p_data_type         => apex_plugin_util.c_data_type_varchar2',
'                  ); ',
'end if;',
'              ',
'task_colno  := apex_plugin_util.get_column_no (',
'                    p_attribute_label   => ''Task column name'',',
'                    p_column_alias      => l_taskname_col,',
'                    p_column_value_list => l_cvalue_list,',
'                    p_is_required       => true,',
'                    p_data_type         => apex_plugin_util.c_data_type_varchar2',
'               ); ',
'id_colno  := apex_plugin_util.get_column_no (',
'                  p_attribute_label   => ''ID'',',
'                  p_column_alias      => l_id_col,',
'                  p_column_value_list => l_cvalue_list,',
'                  p_is_required       => true,',
'                  p_data_type         => apex_plugin_util.c_data_type_varchar2',
'             );',
'            ',
'start_colno  := apex_plugin_util.get_column_no (',
'                     p_attribute_label   => ''Start Date'',',
'                     p_column_alias      => l_start_col,',
'                     p_column_value_list => l_cvalue_list,',
'                     p_is_required       => true,',
'                     p_data_type         => apex_plugin_util.c_data_type_varchar2',
'                 ); ',
'if l_end_col IS NOT NULL then                 ',
'    end_colno  := apex_plugin_util.get_column_no (',
'                       p_attribute_label   => ''End Date'',',
'                       p_column_alias      => l_end_col,',
'                       p_column_value_list => l_cvalue_list,',
'                       p_is_required       => true,',
'                       p_data_type         => apex_plugin_util.c_data_type_varchar2',
'                   ); ',
'end if;   ',
'',
'zstart_colno  := apex_plugin_util.get_column_no (',
'                      p_attribute_label   => ''ZStart Date'',',
'                      p_column_alias      => ''Z_START'',',
'                      p_column_value_list => l_cvalue_list,',
'                      p_is_required       => true,',
'                      p_data_type         => apex_plugin_util.c_data_type_varchar2',
'                 );',
'if l_end_col IS NOT NULL then                  ',
'    zend_colno  := apex_plugin_util.get_column_no (',
'                           p_attribute_label   => ''ZEnd Date'',',
'                           p_column_alias      => ''Z_END'',',
'                           p_column_value_list => l_cvalue_list,',
'                           p_is_required       => true,',
'                           p_data_type         => apex_plugin_util.c_data_type_varchar2',
'                   );',
'end if; ',
'',
'htp.prn(''{"data": {"groups":'' || tnames || '',"tasks":'');',
'-- -------------------------------------',
'-- Build the VIS Dataset',
'-- -------------------------------------',
'',
'tflag := 0;',
'htp.prn(''['');',
'for i in 1 .. l_cvalue_list(1).value_list.count loop ',
'    t_nb := t_nb+1;',
'    ',
'    l_task_val := apex_plugin_util.get_value_as_varchar2 (',
'                             p_data_type => l_cvalue_list(task_colno).data_type,',
'                             p_value     => l_cvalue_list(task_colno).value_list(i)',
'                  );   ',
'    l_res_val := nvl(apex_plugin_util.get_value_as_varchar2 (',
'                             p_data_type => l_cvalue_list(res_colno).data_type,',
'                             p_value     => l_cvalue_list(res_colno).value_list(i)',
'                  ),''TBD'');',
'    if l_ires_col is not null then',
'        l_ires_val := nvl(apex_plugin_util.get_value_as_varchar2 (',
'                             p_data_type => l_cvalue_list(ires_colno).data_type,',
'                             p_value     => l_cvalue_list(ires_colno).value_list(i)',
'                  ),'''');',
'    end if;              ',
'    l_id_val := apex_plugin_util.get_value_as_varchar2 (',
'                             p_data_type => l_cvalue_list(id_colno).data_type,',
'                             p_value     => l_cvalue_list(id_colno).value_list(i)',
'                 ); ',
'    l_zstart_val := apex_plugin_util.get_value_as_varchar2 (',
'                             p_data_type => l_cvalue_list(zstart_colno).data_type,',
'                             p_value     => l_cvalue_list(zstart_colno).value_list(i)',
'                 ); ',
'    if l_end_col is not null then             ',
'        l_zend_val := apex_plugin_util.get_value_as_varchar2 (',
'                             p_data_type => l_cvalue_list(zend_colno).data_type,',
'                             p_value     => l_cvalue_list(zend_colno).value_list(i)',
'                     );              ',
'    end if;    ',
'    ',
'    --htp.p(to_char(l_start_val, ''YYYY-MM-DD"T"HH24:MI:SS''));',
'    --sys.htp.p(l_cvalue_list(1).value_list(start_colno).date_value);',
'     ',
'     if tflag = 1 then',
'        htp.prn('','');',
'     end if;',
'     if l_end_col is not null then ',
'        htp.prn(''{"id": "''||l_id_val||''", "group":"'' ||l_res_val|| ''", "content": "''||l_task_val||''","start": "''||l_zstart_val||''","end": "''||l_zend_val||''","ires": "''||l_ires_val||''"}''); ',
'     else',
